import React from "react";
import "./App.css";
import useExchange from "./data/useExchange";
import CryptoExchange from "./data/CryptoExchange";
import SecuritiesHiRiskExchange from "./data/SecuritiesHiRiskExchange";
import SecuritiesLowRiskExchange from "./data/SecuritiesLowRiskExchange";

const App = () => {
  const rates = useExchange();
  const total =
    CryptoExchange() + SecuritiesHiRiskExchange() + SecuritiesLowRiskExchange();
  const totalUAH = total * rates.UAH;

  return <div className="App">Total: {totalUAH.toFixed(2)} USD</div>;
};

export default React.memo(App);

